    false,nt"url": null,nt"notes": "The Light Detection and Ranging (LiDAR)
    LAS dataset is a survey of select areas within Southwest Florida. These data were
    produced for the Southwest Florida Water Management District (SWFWMD). The Manatee
    and Little Manatee LiDAR Survey project area consists of approximately 176 square
    miles. This data set falls in a portion of Hillsborough and Manatee counties. The
    LiDAR point cloud was flown at a density sufficient to support a maximum final post
    spacing of 6 feet for unobscured areas. 3001 inc. acquired 97 flightlines between
    April 3-11, 2005. The data was divided into 5000' by 5000' foot cells that serve
    as the tiling scheme. The Little Manatee LiDAR Survey was collected under the guidance
    of a Professional Mapper/Surveyor.",nt"license_title": null,nt"extras":
